const Result = (id) => {
  let { params } = useParams();
  console.log(params);
  console.log(window.location.href);

  return (
    <ResultDiv>
      <div className="resultBox">
        <div className="re_bgColor">
          <div className="comment">
            <h3>테스트결과</h3>
            <h1>‘그 때 그 시절의 나는..’</h1>
          </div>
          <img src="" alt="" />
        </div>
      </div>
    </ResultDiv>
  );
};

export default Result;
